import React from 'react';
import Routes from './routes';
import { BrowserRouter } from 'react-router-dom';
import createGlobalStyle from '../src/styles/global'

const App: React.FC = () => (
  <createGlobalStyle>
    <BrowserRouter>
      <Routes />
    </BrowserRouter>
  </createGlobalStyle>

);


export default App;
